We are going to make a series of if statements to verify login details. Reproduce the following: fun main() { var showAccountPage : Boolean = false var user : Boolean = false var password : Boolean = false val userName : String = "AUsername" val userPassword: String = "1c4n234d13375p34k!" // if you know, you know... var inputtedUserName : String? = "" var inputtedPassword : String? = "" println("Username: ") inputtedUserName = readlnOrNull() println("Password: ") inputtedPassword = readlnOrNull() if (userName == inputtedUserName ) { user = true if(userPassword == inputtedPassword){ password = true if (user == true && password == true) { showAccountPage = true print("Successfully logged in") } } else{ print("Password does not match: $inputtedPassword") } } else{ print("Username does not match: $inputtedUserName") }
} Breaking the code down: Booleans showAccountPage: A Boolean variable indicating whether the account page should be displayed. It is set to true only if both username and password match the predefined values. user: A Boolean variable indicating whether the inputted username matches the predefined username. It is set to true if the usernames match. password: A Boolean variable indicating whether the inputted password matches the predefined password. It is set to true if the passwords match. Strings userName: A predefined String containing the correct username. userPassword: A predefined String containing the correct password. Inputs inputtedUserName: A String variable to store the username input by the user. inputtedPassword: A String variable to store the password input by the user. Note that both of these are nullable , ?, meaning that if not String is supplied it is not going to crash Nested if While the code will work as intended, readability is the issue, we have a three deep if. userName is checked, if a match, then password, if a match, then account page. Run the code and try to login using the correct and incorrect credentials. Let's refactor the code and reduce the number of nested ifs: fun main() { var showAccountPage = false var user = false var password = false val userName = "AUsername" val userPassword = "1c4n234d13375p34k!" // if you know, you know... println("Username: ") val inputtedUserName = readlnOrNull() println("Password: ") val inputtedPassword = readlnOrNull() if (userName == inputtedUserName) { user = true } if (userPassword == inputtedPassword) { password = true } if (user && password) { showAccountPage = true println("Successfully logged in") } else { println("Username and or Password does not match") exitProcess(1) }
} Note how we only check to see if the credentials are true, and if they both are we can login, else it does not. We have gone from 32 lines to 27, is there a way to refactor further?
